function CityWeatherCard(props) {
    const {cities} = props;

    return (
      <div>
        CityWeatherCard
        {cities.map((item) => {
            return(
                <>
                    <p>{item.min}</p>
                    <p>{item.max}</p>
                    <p>{item.city}</p>
                </>
            );
        })}
      </div>
    );
  }

  export default CityWeatherCard
